import React from 'react';
import './Headerbar.css';


function Headerbar() {
  return (
    <div className='main'>
        <div className='headerbar-main'>
            <div>logo</div>
            <div>wording</div>
            <div className='headerbar-main-searchbox'>
                <lable className="headerbar-main-searchbox-component">enter the name or location here </lable>
                <input type="text" className='headerbar-main-searchbox-component'/>
                    <div className="search-buttonset">
                        <buttton className='search-button'>by name</buttton>
                        <buttton className='search-button'>by location</buttton>
                    </div>
            </div>
        </div>
    </div>
  )
}

export default Headerbar;
